import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Form,
  Navbar,
  Container,
  Row,
  Col,
  Nav,
  NavDropdown,
  FormControl,
  Button,
  Card,
} from "react-bootstrap";
//import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import NavBar from "./NavBar";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";

class Canvas extends React.Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <div className="igniteMain">
        <div className="header">
          <NavBar />
          <MDBContainer>
            <MDBRow>
              <MDBCol size="9">
                <Card>Content</Card>
              </MDBCol>
              <MDBCol size="4">
                <Card>Content</Card>
              </MDBCol>
              <MDBCol size="6">
                <Card>Content</Card>
              </MDBCol>
            </MDBRow>
          </MDBContainer>
          {/*
            <Container>
              <Row>
                <Col md={4}>md=4</Col>
                <Col
                  md={{ span: 4, offset: 4 }}
                >{`md={{ span: 4, offset: 4 }}`}</Col>
              </Row>
              <Row>
                <Col
                  md={{ span: 3, offset: 3 }}
                >{`md={{ span: 3, offset: 3 }}`}</Col>
                <Col
                  md={{ span: 3, offset: 3 }}
                >{`md={{ span: 3, offset: 3 }}`}</Col>
              </Row>
              <Row>
                <Col
                  md={{ span: 6, offset: 3 }}
                >{`md={{ span: 6, offset: 3 }}`}</Col>
              </Row>
            </Container>
          */}
        </div>
      </div>
    );
  }
}

export default Canvas;
